import React, { useState } from 'react'
import image from "../images/pexels-tima-miroshnichenko-6169659.jpg";
import Icons from './Icons';
import JsonFetcher from '../JsonFetcher';

function Project() {
    const [jsonData, setJsonData] = useState(null);

    const handleDataFetch = data => {
    setJsonData(data);
    };
  return (
    <div>
        <JsonFetcher url="../myData/data.json" onDataFetch={handleDataFetch} />
        {jsonData && (
        <div>
          {jsonData.map(item => (
              <div key={item.id} class="project-grid  row mb-5">
                <div class="project">
                    <div class="flex-container  p-4 border bg-light">
                        <h4>{item.name}</h4>
                        <p class="d-inline-block">
                        {item.description}
                        </p>
                        <div class="project__icons">
                            <Icons/>
                        </div>
                    </div>
                </div>
            </div>
          ))}
        </div>
      )}
        <div class="project-grid  row mb-5">
            <div class="project">
                <div class="flex-container  p-4 border bg-light">
                    <h4>The Optical Business Website </h4>
                    <p class="d-inline-block">
                    A clinical healthcare website helps to conduct online diagnostic tests for eye
                    concerned patients and reservation system where they will undergo medical related
                    questions from the doctor's record. Result will be then sent to the doctor's log using
                    API for them to analyze for possible physical check-up or drug recommendation
                    </p>
                    <div class="project__icons">
                        <Icons/>
                    </div>
                </div>
            </div>
            <div class="">
                <img class="rounded float-start portfolio-image" style={{width:"-webkit-fill-available"}} src={`${image}`} alt="" />
            </div>
        </div>
    </div>
  )
}

export default Project
